import jsonimport requestsurl = "http://alobgames.com:8080/getserverlist"a = requests.get(url)max_text = a.textaa = json.loads(max_text)max = aa['max']def getlist():    for page in range(1,max+1):        print("当前是"+str(page)+"页")        headers = {        "User-Agent": "UnityPlayer/2023.2.0b1 (UnityWebRequest/1.0, libcurl/8.1.1-DEV)",        "Accept": "*/*",        "Accept-Encoding": "deflate, gzip",        "page": str(page),        "platform": "Android",        "ver": "26",        "data_ver": "1",        "X-Unity-Version": "2023.2.0b1"        }        res = requests.get(url,headers=headers)        text = res.text        text_msg = json.loads(text)        for i in range(9):            a = text_msg.get(str(i))            if a != None:               name = a.get("name")            aa = text_msg.get(str(i))            if aa != None:               ip = aa.get("ip")            aaa = text_msg.get(str(i))            if aaa != None:               port = aaa.get("port")                        print("=============================================")            print(f"服务器名称:{name}\n服务器IP:{ip}\n服务器端口:{port}\n")